  /*     %% get_next_dir_diagonal Lis,s */
  /* o` */
  *next_dir = g_d_direction.North;
  next_node[0] = 1U;
  next_node[1] = 1U;
  *next_node_property = matrix_dir.Row;

  /* GbWS[m[h */
  p = false;
