            if (i46 > 33) {
              emlrtDynamicBoundsCheckR2012b(i46, 1, 33, &mib_emlrtBCI, sp);
            }

            map_min = row_num_node[(i46 + 33 * (current_node[1] - 1)) - 1];

            /* m[hisk */
