static real_T goal_judge(const uint8_T maze_goal[18], uint8_T x, uint8_T y)
{
  int32_T i40;
  uint8_T uv0[18];
  boolean_T temp1[18];
  int32_T ex;
  int8_T varargin_1[9];
  int32_T k;
  covrtLogFcn(&emlrtCoverageInstance, 1U, 18U);
  covrtLogBasicBlock(&emlrtCoverageInstance, 1U, 325U);

  /* S[ */
  /* Wz */
  /* S[Wr */
  for (i40 = 0; i40 < 9; i40++) {
    uv0[i40] = x;
    uv0[9 + i40] = y;
  }

  for (i40 = 0; i40 < 18; i40++) {
    temp1[i40] = (maze_goal[i40] == uv0[i40]);
  }

  /* x,yvmFAv1 */
  for (i40 = 0; i40 < 9; i40++) {
    varargin_1[i40] = (int8_T)(temp1[i40] * temp1[9 + i40]);
  }

  ex = varargin_1[0];
  for (k = 0; k < 8; k++) {
    i40 = varargin_1[k + 1];
    if (ex < i40) {
      ex = i40;
    }
  }

  return ex;
}

